    });

    const group = [
        "adventruer", 
        "cygnus",
        "resistance",
        "hero",
        "grandis", 
        "zero",
        "kinesis",
    ]

    return (
        <ul className="sidebar">
            <li className="sidebar__group sidebar__group__active pointer">
                <Link href={`/${props.title}/Adventurer`}><a href="#">모험가</a></Link>
            </li>
            <li className="sidebar__group sidebar__group__none pointer">
